import { NavLink } from "react-router-dom";
import "./Menu.css";

function Menu(): JSX.Element {
    return (
        <div className="Menu">
            <NavLink to="/home">Home</NavLink>
            <NavLink to="/Productse">Products</NavLink>
            <NavLink to="/About">About</NavLink>

        </div>
    );
}

export default Menu;
